import React from 'react';
import card1 from './Images/Component 9 – 1.png'
const Course2=()=>{
    return(
<>
<div className="container-fluid course_div">
<div className="row">

<div className="card1">
    <img src={card1}/>
</div>

</div>
</div>
</>
    );
};
export default Course2;
